/*Table structure for table `frases` */

DROP TABLE IF EXISTS `frases`;

CREATE TABLE `frases` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `frase` varchar(500) DEFAULT NULL,
  `observacion` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=103 DEFAULT CHARSET=latin1;

/*Data for the table `frases` */

insert  into `frases`(`id`,`frase`,`observacion`) values (1,'Cuando el monje budista volvi al hoyo esperaba ver la momia de su maestro sentada en flor de loto y con una expresin de paz. Al abrir la puerta vio en la momia una expresin de horror y las uas destruidas por araar las paredes.','Terror en Frases Cortas'),(2,'Sigo en la bodega del barco escondido. Estoy cansado de comer ratas por fortuna ya empezaron a morir los hombres.','Terror en Frases Cortas'),(3,'Los sbados, a las diez de la noche, los demonios salen de las botellas para recolectar almas. Los celos y los autos son sus mejores armas.','Terror en Frases Cortas'),(4,'De nada sirvi decirle a la inquisicin que se arrepenta de sus pecados; igual lo quemaron. Y al llegar al infierno lo volvieron a quemar.','Terror en Frases Cortas'),(5,'Fue devoto toda su vida. Siempre crey en el cielo y en el infierno; pero ahora que muri y todo est oscuro no sabe qu hacer.','Terror en Frases Cortas'),(6,'Cuando ella se enter que estaba siendo raptada, ya era muy tarde: Su piel empez a desprenderse de sus huesos y sus ojos se hicieron agua. Al llegar, los captores slo tenan un esqueleto.','Terror en Frases Cortas'),(7,'La abuela, sentada en su mecedora, dej de respirar ya hace varias horas pero sigue tarareando esa horrible cancin.','Terror en Frases Cortas'),(8,'Ella no supo qu decir cuando vio a su marido all en la habitacin, durmiendo como si nada. Cmo haba escapado del stano donde lo haba encerrado despus de apualarlo?','Terror en Frases Cortas'),(9,'El nio no meta la mano entre la cama y la pared porque tema que la araa del rincn lo picara. Entonces la araa se cans de esperar y subi hasta su cuello mientras dorma.','Terror en Frases Cortas'),(10,'Se senta observado, sin saber que era l quien, translucido, observaba...','Terror en Frases Cortas'),(11,'Buscaron a su hijo desaparecido durante doce aos, sin saber que cada vez que regaban el jardn tambin regaban sus huesos.','Terror en Frases Cortas'),(12,'En ese momento por fin se sinti libre, volando, con el cabello danzante por el viento y las gotas refrescantes en el rostro, sus ojos cerrados y una gran sonrisa en sus labios. Al mismo tiempo, sus amigos vean horrorizados como ella desapareca de la cima de la cascada.','Terror en Frases Cortas'),(13,'La letana en la pared mencionaba una horrible tortura a una pequea nia. La letana era una historia real.','Terror en Frases Cortas'),(14,'Hay tres poderes en el mundo: La inteligencia, el dinero y la belleza; pero slo los dos primeros son acumulables.','Ensayo sobre el Poder'),(15,'En la sociedad no es lo que sea, es lo que se vea.','Ensayo sobre el Poder'),(16,'En promedio, es la mente mucho ms cruel que la realidad.','Ataque de Ansiedad'),(17,'Los artistas no somos mejores que los mdicos o los cientficos, pero a menudo lo creemos as, ciegos de arrogancia al pensar que nuestra obra es maestra y cambiar al mundo.','Crtica al Artista'),(18,'Si se vive del arte se necesita un mecenas, de lo contrario las obras se convierten en negocios.','Crtica al Artista'),(19,'El hombre busca tener una novia por tres motivos: Sexo, soledad o ego. Pero en general el amor llega sin buscarlo.','Pensamientos'),(20,'Quien se encuentra a gusto con sus defectos, independiente de su edad, est condenado a dejar de evolucionar.','Pensamientos'),(21,'El experto debe enfocarse en una sola rea del conocimiento. Quien sabe de todo en verdad sabe poco de todo.','Ensayo sobre el Poder'),(22,'El inicio de la msica es el sonido del mar, del viento y de los rayos; el cantar de las aves y el rugir de la lluvia. De las bellas artes, es la msica la ms degradada.','Crtica al Artista'),(23,'La envida no se crea por personas que estn ms arriba o ms abajo. Las personas superiores causan admiracin y las inferiores causan lstima o desinters. La envdia se despierta entre pares.','Ensayo sobre el Poder'),(24,'El don del habla a menudo es ms fuerte y a la vez ms peligroso que el don de la fuerza. La fuerza se aplica contra un enemigo a la vez, mientras que el habla mueve naciones.','Ensayo sobre el Poder'),(25,'Cuando la cabeza se llena de pensamientos futuros, se vuelve tan pesada que impide continuar el camino.','Ataque de Ansiedad'),(26,'El mejor momento de la vida es el ahora, precisamente porque es ahora.','Pensamientos'),(27,'Soy consciente del karma, pero s que el hombre no obtiene lo que merece, obtiene lo que consigue.','Ensayo sobre el Poder'),(28,'Alcanzar el amor platnico implica quitarse la venda de los ojos, por lo que a menudo significa decepcin.','Pensamientos'),(29,'Saba que Mara era hermosa, pero un mnimo detalle de fealdad en ella resaltaba como una estrella en medio de una noche sin nubes. La maldicin de las mujeres bellas es que la fealdad en ellas se hace ms notoria cuando llega, lo que las obliga a estar siempre hermosas.','El Castillo de la Quimera'),(30,'Por instinto nos apegamos a lo conocido, a quien nos parecemos; nos molesta lo inentendible. Los dioses son los que deben adaptarse a sus creyentes, pues de lo contrario los creyentes no comprendern a los dioses.','Nallhard'),(31,'Era en verdad un completo idiota; pues es bien sabido que no hay que darle poder a un hombre joven, porque a menudo distorsiona su propia realidad.','Eidhard'),(32,'Imaginaba a sus enemigos lerdos, patizambos y dbiles; y por qu no los imaginara as? Si as eran los aldeanos que haba conocido toda su vida. El joven pocas veces haba visto soldados de verdad, por lo que supona deban ser como l: valientes, altos y fuertes. Pero no imaginaba as a sus enemigos, pues eran el enemigo y con el enemigo no se tiene empata.','Eidhard'),(33,'A excepcin de dependencias economicas o custodias, la mujer a menudo pierde el poder sobre el hombre si el hombre pierde el inters.','Ensayo sobre el Poder'),(34,'Espero que todo salga bien, pues la verdad cada ataque de Valentina me roba la tranquilidad, y la tranquilidad es la felicidad.','Cada Minuto a su Lado'),(35,'Mi madre me dice que mi hermana me est esperando en la sala. Pero es imposible porque yo ya quem el cuerpo. Voy a la sala y veo la parte posterior de su cabeza y su espalda erguida no quiero ver su rostro.','Terror en Frases Cortas'),(37,'Apenas entr a la tienda sent todas las terribles miradas sobre m. Camin por todos lados y me di cuenta que me seguan con sus ojos vacos, como vigilantes, sin mover sus cabezas. Era horrible sentir esas miradas. La tienda era una fbrica vieja de muecas.','Terror en Frases Cortas'),(38,'Cuando por fin pudo vomitar, sinti cmo sala de su garganta ese horrible y largo parsito. Cuando ya estuvo finalmente en el suelo, el horrible y pegajoso invertebrado le dijo: - Por favor, djame volver a entrar.','Terror en Frases Cortas'),(39,'Cada vez suba ms el volumen de la msica, slo para acallar los gritos del stano.','Terror en Frases Cortas'),(40,'El nio llor al ver su mueco favorito de pie sobre la mesa, pues record que antes del accidente l tambin poda ponerse de pie.','Terror en Frases Cortas'),(41,'l espero por ella bajo la lluvia mucho tiempo, pero ella ni siquiera se haba dado cuenta que estaba lloviendo.','Terror en Frases Cortas'),(42,'Las dos variables del xito o del fracaso son la inteligencia y la disciplina, aunque la suerte a menudo influye.','Ensayo sobre el Poder'),(43,'A menudo las mujeres independientes causan desinters en los hombres. Esto se puede dar por inseguridad del hombre o porque no despiertan el instinto paternal y protector.','Ensayo sobre el Poder'),(44,'El grito es el sonido de la ignoracia, el temor y la impotencia.','Ensayo sobre el Poder'),(45,'Es preferible conocer la obra antes que al artista. De lo contrario la subjetividad hacia el autor deformar la percepcin hacia la obra.','Crtica al Artista'),(46,'El dinero y la belleza abren puertas, pero sus dueos se encargan de cerrarlas.','Ensayo sobre el Poder'),(47,'La bondad traer paz, y la paz felicidad. El tirano nunca conciliar el sueo.','Ensayo sobre el Poder'),(48,'La duda puede estar en la planeacin, pero nunca en la accin.','Pensamientos'),(49,'Todo lo que se politiza se pudre. Claros ejemplos son: la religin, la ley, la industria. Todo se daa.','Ensayo sobre el Poder'),(50,'Mantenerse en la cima resulta ms estresante que llegar a ella.','Ensayo sobre el Poder'),(51,'Llegar al cielo desde el infierno permite al alma conocer todo el camino. Nacer en el cielo y caer al infierno es mucho ms trgico.','Pensamientos'),(52,'Ningn artista es verdaderamente original. Todos imitamos a nuestros maestros. La nica diferencia es que algunos los superan en fama y otros logran mantener ocultas sus fuentes.','Crtica al Artista'),(53,'Se debe ser un buen vendedor, incluso de su propia imagen. Se puede tener el mejor producto del mundo, pero si permanece en una gaveta y nadie lo conoce entonces no existe.','Ensayo sobre el Poder'),(54,'La soledad voluntaria es muy diferente a la soledad obligatoria. La primera es un privilegio, pero la segunda es un verdadero tormento.','Pensamientos'),(55,'Quien desea el mal a otras personas slo quiere hacer menos profunda su miseria.','Pensamientos'),(56,'La expresin \"Es que usted no sabe qu es la vida\" normalmente nace del dolor y del resentimiento, pues asume que vivir la vida es sufrimiento. La vida consiste en alcanzar metas, pequeas o grandes, aunque el sufrimiento est constantemente entre ellas y nosotros.','Pensamientos'),(57,'La zona de \"confort\" debe ser abandonada cuando en verdad no es de \"confort\", pero si esta zona trae felicidad, piensa que invertiste muchos aos en crearla para abandonarla sin motivo.','Pensamientos'),(58,'Pero la desgracia lleg el cuarto da, vestida con belleza, como el Demonio la prefiere.','El Imperio de los Dos Soles'),(59,'La vanidad es la caracterstica del gnero femenino; y el verse opacada por la belleza de otra mujer es simplemente desaparecer.','El Imperio de los Dos Soles'),(60,'Espero que pocos amen mi arte. Si la masa adopta lo que escribo, entonces estoy haciendo algo mal. El arte es exclusivo, y prefiero que pocos sientan mi escritura a que muchos simplemente la acaricien. Un ejemplo es la biblia: todos la conocen, pero pocos en verdad la leen.','Crtica al Artista'),(61,'Los humanos siempre desean ms, sin conformarse nunca. Parecemos una horrible bestia que siempre tiene hambre, y que tarde o temprano resultar comindose a s misma, pues con el tiempo ya todo lo habr devorado.','El Imperio de los Dos Soles'),(62,'Espero que el hombre tenga mucha capacidad de crear, para que cuando lo haya destruido todo sea capaz de reconstruirlo.','El Imperio de los Dos Soles'),(63,'El mundo es pequeo en el universo, pero no lo suficiente para la mano de un solo Hombre.','El Imperio de los Dos Soles'),(64,'El Hombre es el que pone sus propios imposibles, pero culpa a sus metas.','La Edad de las Estrellas'),(65,'Uno no tiene lo que se merece, uno tiene lo que consigue.','La Edad de las Estrellas'),(66,'Idiotas han habido en todas las generaciones, pero con las redes sociales evidenciamos su enorme cantidad.','Pensamientos'),(67,'El problema del fanatismo y el extremismo es que convierte las causas justas en simples burlas.','Pensamientos'),(68,'La belleza slo existe cuando se ve, pero no trasciende ni cambia el curso del mundo. La mujer que es slo bella fsicamente es olvidada si no es visible.','Ensayo sobre el Poder'),(69,'Rebajar o criticar las virtudes de los dems es un simple autoengao para hacer la vida menos miserable.','Pensamientos'),(70,'La valenta crece al sentir el peligro alejado. Insultar es sencillo cuando no se tiene al insultado al frente.','Pensamientos'),(71,'Cuando el conocimiento es desproporcionado en una discusin, siempre ganar el idiota, pues el intelecto intenta llegar a consensos, mientras la idiotez simplemente se cierra al aprendizaje. Slo puede haber debate sano entre mentes abiertas.','Ensayo sobre el Poder'),(72,'Imagina no poder descansar del dolor y del sufrimiento, del hambre y de la sed, del fro y del ardor. La prolongacin de una mala vida es una maldicin','La Edad de las Estrellas'),(73,'Deja la esperanza, pues la esperanza causa miedo de no cumplirse. Slo vive el presente.','Pensamientos'),(74,'Debes tener la mente como un lago calmo y limpio, he ah la tranquilidad y la lucidez que lleva a la plenitud.','Pensamientos'),(75,'Si tu mente vaga fuera del presente puedes caer en el vaco del aburrimiento o en el caos de la \r\ninquietud.','Pensamientos'),(76,'Slo las mentiras deben ser ratificadas continuamente. La verdad no requiere memoria.','Pensamientos'),(77,'Ella era de rizos castaos, de ojos verdes como jades, de rostro fino y de facciones que se acercaban a la perfeccin y al gusto de todos los mortales. Pareca ser el deleite de los ngeles, la envidia de la belleza, la presa de las beldades y la tentacin de los Demonios. Irradiaba un aura enigmtica, de calma, e inmolaba sentimientos muy profundos.','La Edad de las Estrellas'),(78,'La primera bestia emergi vestida de llamas rojas, derritiendo todo a su alrededor, y calcinando con su intolerancia carne y tendones de conocidos y desconocidos. ','La Cancin Glacial'),(79,'A menudo los hombres tienen una gran ceguera para justificar sus actos en vez de admitir sus errores.','La Edad de las Estrellas'),(80,'La verdad temo que todo salta mal, pero debo dudar antes de ejecutar, porque despus de ejecutado no puedo tener dudas.','La Edad de las Estrellas'),(81,'En la adolescencia y en la juventud, el poder entre los hombres y las mujeres es desproporcionado. Ellas siempre dominarn a los veinte aos. Los hombres deben llenarse de paciencia, pues slo despus de los treinta aos la balanza puede empezar a cambiar.','Ensayo sobre el Poder'),(82,'Estaba listo para ir a dormir, pero sent de nuevo el hedor nauseabundo y escuch el lento chirriar de la puerta. Entonces supe que ese maldito perro se haba desenterrado de nuevo. Ya casi no tena piel en los huesos, y no tena ojos ni orejas. Pero lo dejar dormir de nuevo hoy a mis pies, aunque apeste. Maana lo enterrar de nuevo en el cementerio de animales.','Terror en Frases Cortas'),(83,'Ella intentaba salvar a los marineros al otro lado del agua, sin saber que ella, con su canto, era quien los ahogaba.','Terror en Frases Cortas'),(84,'La nevera estara vaca si los pedazos de su pareja no estuvieran all.','Terror en Frases Cortas'),(85,'Todos los mineros dejaron de cavar el tnel cuando escucharon un llanto de un beb a kilmetros de profundidad.','Terror en Frases Cortas'),(86,'Era tan bella que cualquier imperfeccin le pareca monstruosa, y llevada por la vanidad en verdad se convirti en un monstruo.','Terror en Frases Cortas'),(87,'Toda la familia qued sorprendida al ver que la foto en el atad no era la del fallecido, sino la de su hijo, presente en el funeral. Pensaron que fue un error, pero en verdad fue una premonicin cumplida tan slo dos das despus.','Terror en Frases Cortas'),(88,'Despus de muchos aos de encierro por fin senta el viento en su rostro, el problema es que al mismo tiempo senta la terrible soga en el cuello.','Terror en Frases Cortas'),(89,'Si los fantasmas en verdad existen, entonces debe haber ms fantasmas que seres humanos.','Terror en Frases Cortas'),(90,'Decidi mutilarse cuando sus piernas empezaron a hablarle.','Terror en Frases Cortas'),(91,'No hay mayor bajeza que disfrazar el privilegio con arengas de igualdad.','Ensayo sobre el Poder'),(92,'La soledad voluntaria puede ser reconfortante, sosegada, incluso maravillosa; pues permite un reencuentro entre el cuerpo y el alma. Pero la soledad obligada es horrible, pesada, lacera el pensamiento y empuja a la locura. Por eso es un castigo en las crceles. Que no hable de soledad quien nunca ha estado obligado a estar solo.','Pensamientos'),(93,'Subi las escaleras del templo al alba. Se pos frente a la estatua de Buda, se arrodill y rez con profundidad. Y cuando abri los ojos vio, aterrorizado, que la estatua de piedra tambin tena los ojos abiertos, muy abiertos.','Terror en Frases Cortas'),(94,'Muchos se disparan en la cabeza, pero antes gritan que los dems cargaron el arma. Esto no slo demuestra cobarda, tambin demuestra la incapacidad de manejar un problema... y no hablo necesariamente de un suicidio.','Pensamientos'),(95,'Nunca hubo tantos idiotas en el mundo, pero tampoco hubo nunca tantas mentes brillantes. El problema es que a los genios slo se les reconoce cuando ya no estn. Incluso, a menudo ni se les reconoce.','Pensamientos'),(96,'Quien culpa a los dems es incapaz de evolucionar, porque se enfoca en los problemas externos en vez de los internos.','Pensamientos'),(97,'Entre ms simples los gustos, ms felicidad se abarca.','Pensamientos'),(98,'La crueldad hacia la humanidad puede ser impulsada por la venganza; pero la verdadera crueldad se muestra en quien maltrata a los animales. Quien daa a los animales no se venga, es simplemente maligno.','Pensamientos'),(99,'Quien es feliz no discute.','Pensamientos'),(100,'Hay dos variables que determinan el xito: la disciplina y la inteligencia. Pero hay una tercera que casi siempre es determinante: la suerte. Slo el pas donde naces y el idioma que hablas puede inhabilitar las dos primeras.','Ensayo sobre el Poder'),(101,'Tal felicidad era slo una ilusin, pues saban que la armona y la tranquilidad no eran eternas, slo prolongables, al igual que la belleza.','La Edad de las Estrellas'),(102,'An tengo el recuerdo de mi hermana, encorvada sobre la cama, convertida completamente en un monstruo; y esa horrible imagen es la que viene a m en las noches, cuando todo est oscuro y en silencio, atormentndome hasta que llega de nuevo el alba.','Monstruo');

